    fn ex2() {
        assert_eq!(longest_in("bbbb"), 1);
    }

    #[test]
    fn ex3() {
        assert_eq!(longest_in("pwwkew"), 3);
    }

    #[test]
    fn ex4() {
        assert_eq!(longest_in(""), 0);
    }

